import React from 'react';
import {Link} from 'react-router-dom';
import img from "../../../public/Images/logo"
const myStore = (props) => {
  return (
    <div className="customer" style={{width:"20%",display:"inline-block"}}>
      <a href={props.url} target="_blank" style={{backgroundImage:"url(img)"}}>{props.name}</a>
    </div>
  )
}
export default myStore;
